import React, { useState } from "react";
import "./index.css";

const Modal = ({ visible, tabState }) => {
  return (
    <div className={{ visible } ? "modalopen" : "modalclosed"}>
      {visible}guh{tabState}
    </div>
  );
};

export default Modal;
